      <h2 className=" p-4 pt-2 text-3xl text-center font-bold">
        Keyboard Test Utility
      </h2>
      <div className="flex flex-col items-center justify-center h-screen">
        <div className=" flex-col items-center justify-center w-1/2 grid ">
          <KeyButton InnerText={"Enter"} />
